import React from 'react'
import { useLocation } from 'react-router';
import './Error.css';

const Error = () => {
    const message = useLocation();
    

    return (
        <div className="error">
            <h1> The Page is not available</h1>
            { message? <p>message</p> : ""}
        </div>
    )
}

export default Error
